const PaperStyle = {
	root: {
		padding: "0",
		margin: "0",
		width: "50%",
		height: "100%",
		marginBottom: "20px",
		paddingRight: "10px",
		"p @media (min-width: 992px)": {
			fontSize: "0.748rem"
		}
	},
	paper: {
		border: "0.8px solid #3c485833",
		boxShadow: "1px 1px 1px 1px #3c485833",
		paddingTop: "20px",
		paddingBottom: "20px",
		paddingLeft: "10px",
		paddingRight: "10px",
		borderRadius: "0 !important"
	},
}

export default PaperStyle;
